import React from 'react';
import { Routes, Route, BrowserRouter } from 'react-router-dom'; // Only Routes and Route
import './App.css';

import Header from './components/header';
import Navbar from './components/navbar';
import Footer from './components/footer';
import Home from './components/home';
import Login from './pages/login';
import Companies from './pages/companies'; // Uncomment if you have a Companies page
import Register from './pages/register'; // Uncomment if you have a Register page

function App() {
  return (
    <BrowserRouter>
     <Navbar />
      <Header />
      <Home />
      <Login />
      <Companies />
      <Register />
      <Footer />



  // <Routes>
   <Route path="/" element={<Home />} />
   <Route path="/login" element={<Login />} />
   <Route path="/companies" element={<Companies />} />
  <Route path="/register" element={<Register />} />
</Routes>
      </BrowserRouter>

  );
}

export default App;
